description:
Slaughterhouse has it all, a group of amazing skateboarders laying it down on all terrain, bringing together the most slashing, creative, rippingest team in skateboarding. 

The team has worked hard and has gained respect from all who witness their talents. Slaughterhouse is what skateboarding is truly about: having fun, skating everything and anything and being yourself. 

Featuring Adrian Mallory, Charlie Castelluzzo, Lizard King, Sammy Baca, Shuriken Shannon, Slash and Ragdoll.

